import React,{useState} from "react";
import { TextField, Button, Box , Typography} from "@mui/material";

export default function Login() {
  const [isLoginMode, setIsLoginMode]=useState(true)
  const [showErrorEmail, setShowErrorEmail]=useState(false)
  const [showErrorPassword, setShowErrorPassword]=useState(false)

  const handleSubmit=(e)=>{
    e.preventDefault()

  }
  const switchModeHandler=()=>{
    setIsLoginMode(prev=>!prev)
  }

  return (
    <>
      <Grid
        item
        xs={false}
        sm={4}
        md={7}
        sx={{
          backgroundImage: '../73E53A21-8304-4F67-9CDF-DD49529E11A7.JPG',
          backgroundRepeat: 'no-repeat',
          backgroundColor: (t) =>
            t.palette.mode === 'light' ? t.palette.grey[50] : t.palette.grey[900],
          backgroundSize: 'cover',
          backgroundPosition: 'center',
        }}
      />
      <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
        <Box
          sx={{my: 8, mx: 4, display: 'flex', flexDirection: 'column', alignItems: 'center',}}
        >
          <Typography component="h1" variant="h5">{isLoginMode?'LOG IN': 'SIGN UP'}</Typography>
          <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
            {! isLoginMode && (
            <TextField
              error
              id="outlined-error-helper-text"
              label="Error"
              required
              defaultValue="Hello World"
              helperText="Incorrect entry."
            />)}
            <TextField
              error={showErrorEmail}
              helperText={showErrorEmail}
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
            />
            <TextField
              error={showErrorPwd}
              helperText={showErrorPwd}
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
            />
            <Button variant="contained" type="submit" fullWidth sx={{ mt: 3, mb: 2 }}>Submit</Button>
          </Box>
          <Button variant="outlined" fullWidth onClick={switchModeHandler}>SWITCH TO {isLoginMode?'SIGN UP': 'LOG IN'}</Button>
        </Box>
      </Grid>
    </>
  )
}
